urs tableaux comparatifs sont illisibles. Et enlever le multi de la partie F2P c\'est du non sens.\r\nIls auraient du faire une version F2P avec le online, quelques courses au solo, et une payante avec les skins, l\'ÃƒÂ©diteur, le solo complet... ÃƒÂ§a aurait 10x plus logique et lisible\r\n\r\nEnsuite l\'ergonomie, avant c\'ÃƒÂ©tait simple, un menu avec boutons, avec une liste de serveur, maintenant tout est mÃƒÂ©langÃƒÂ©, on comprends rien, il y en a partout c\'est un fouillis sans nom.\r\nEn jeu c\'est pas mieux, la camÃƒÂ©ra 3 est impraticable, les nouveaux blocs &quot;bonus&quot; sont pas facilement identifiable sur la route. La nouvelle fonctionnalitÃƒÂ© de pas perdre sa vitesse au checkpoint est sympa, mais ils ont mÃƒÂªme pas pensÃƒÂ© qu\'on puisse ne pas avoir envie de toujours garder sa vitesse si ÃƒÂ§a trajectoire est naze, du coup c\'est plus inutile qu\'autre chose\r\n\r\nGraphiquement, le jeu est tristoune, moins de dÃƒÂ©co, tout est fade et trop ÃƒÂ©purÃƒÂ© (et pas ÃƒÂ©purÃƒÂ© style chic et lisible, mais plutÃƒÂ´t ÃƒÂ©purÃƒÂ© cheapos). En terme d\'options leur anti-aliasing rend le jeu flou (surement un TAA mal foutu), et on a toujours droit ÃƒÂ  un jeu ÃƒÂ  moitiÃƒÂ© freezÃƒÂ© pendant les chargements. Chargement un peu long d\'ailleurs. J\'ai une suggestion : Pourquoi ne pas telecharger/charger la map suivante quand on joue ?\r\n\r\nBref, pour l\'instant, on a l\'impression d\'avoir un jeu pas terminÃƒÂ© avec des choix de design et marketing douteux. Alors que c\'est un jeu qui est peut ÃƒÂªtre vraiment fÃƒÂ©dÃƒÂ©rateur, tellement c\'est simple ÃƒÂ  comprendre et basique (et c\'est ÃƒÂ§a qui est bon)',12,34,31),(27,'Je pense que beaucoup de personnes ne sont pas honnetes avec eux meme. Oui, le jeu ressemble ÃƒÂ  une pale copie de Gta. Et alors? Arriver au niveau de Rockstar dans ce style de jeu mets de nombreuses annÃƒÂ©es.\r\nAyant ÃƒÂ©tÃƒÂ© le premier ÃƒÂ  cracher sur WD1, ce WD2 est carrÃƒÂ©ment supÃƒÂ©rieur et on vois une nette ÃƒÂ©volution dans le gameplay, le scÃƒÂ©nario, et les interactions.\r\nApres, bcp de chemin restent ÃƒÂ  parcourir mais donner des notes infÃƒÂ©rieur ÃƒÂ  12, c\'est etre malhonnÃƒÂªte avec sois mÃƒÂªme...',15,34,32),(28,'ok',2,39,21),(29,'Dommage',14,45,28);
